INSERT INTO `moment_tags` VALUES (1,'A Striking Developments (Reveals Insight into who your child is)',NULL,NULL,NULL,NULL,'2012-04-12 11:43:52','2012-04-12 11:43:52',NULL,NULL,NULL),(2,'',NULL,NULL,NULL,NULL,'2012-04-12 11:43:52','2012-04-12 11:43:52',1,0,'1'),(3,'Thinking/Cognitive Reasoning',NULL,'range','1. Not Like YOURCHILD At All   2. A Little Like YOURCHILD,  3. Somewhat Like YOURCHILD, 4. Mostly Like YOURCHILD, 5.  Very Much Like YOURCHILD,','YOURCHILD enjoys logic problems, puzzles and anything to do with thinking and problem solviing.','2012-04-12 11:43:53','2012-04-12 11:43:53',2,1,'1>>2'),(4,'Basic Mental Processing',NULL,'range','1 - 5','YOURCHILD has good intuition and can quickly recognize situations and respond in appropriate ways.','2012-04-12 11:43:54','2012-04-12 11:43:54',3,2,'1>>2>>3'),(5,'Attention Control',NULL,'range','1 - 5','YOURCHILD has good control of HIS/HER attention. HE/SHE rarely looks off in a blank stare nor tunes in and out like a flickering candle.','2012-04-12 11:43:56','2012-04-12 11:43:56',4,3,'1>>2>>3>>4'),(6,'Mental Energy Controls',NULL,'range','1 - 5','YOURCHILD sometimes seems to just run out of gas when doing mental work. HE/SHE becomes real tired or bored and cannot finish HIS/HER work. (N)','2012-04-12 11:43:56','2012-04-12 11:43:56',5,4,'1>>2>>3>>4>>5'),(7,'Intake Controls',NULL,'range','1 - 5','YOURCHILD  sometimes has difficulty managing the daily deluge of data. HE/SHE becomes bogged down and cannot easily transition to the next relevant topic or activity. (N)','2012-04-12 11:43:57','2012-04-12 11:43:57',5,4,'1>>2>>3>>4>>5'),(8,'Output Controls',NULL,'range','1 - 5','YOURCHILD rarely loses it, blurting out or does things without thinking first','2012-04-12 11:43:57','2012-04-12 11:43:57',5,4,'1>>2>>3>>4>>5'),(9,'Visual & Spatial Ordering',NULL,'range','1 - 5','YOURCHILD has a good sense of direction.','2012-04-12 11:43:58','2012-04-12 11:43:58',4,3,'1>>2>>3>>4'),(10,'Visual & Spatial Ordering',NULL,'range','1 - 5','YOURCHILD likes to use charts and diagrams in HIS/HER learning.','2012-04-12 11:43:58','2012-04-12 11:43:58',4,3,'1>>2>>3>>4'),(11,'Spatial Awareness & Perception',NULL,'range','1 - 5','YOURCHILD is alert to and can quickly identify all sorts of shapes and objects in books or in his surroundings','2012-04-12 11:43:59','2012-04-12 11:43:59',9,4,'1>>2>>3>>4>>9'),(12,'Spatial Memory',NULL,'range','1 - 5','YOURCHILD can picture scenes in HIS/HER head when remembering things.','2012-04-12 11:43:59','2012-04-12 11:43:59',9,4,'1>>2>>3>>4>>9'),(13,'Spatial Output & Mgmt',NULL,'range','1 - 5','YOURCHILD can make accurate representations, sketches, drawings of objects and things or organizes their closet and room in an orderly way','2012-04-12 11:44:00','2012-04-12 11:44:00',9,4,'1>>2>>3>>4>>9'),(14,'Logical & Sequential Ordering',NULL,'range','1 - 5','YOURCHILD is good at mathematical problems and using numbers.','2012-04-12 11:44:00','2012-04-12 11:44:00',4,3,'1>>2>>3>>4'),(15,'Sequential Awareness & Perception',NULL,'range','1 - 5','YOURCHILD can link things together and pick out patterns easily.','2012-04-12 11:44:01','2012-04-12 11:44:01',14,4,'1>>2>>3>>4>>14'),(16,'Sequential Memory',NULL,'range','1 - 5','YOURCHILD can easily remember phone numbers or other numbers.','2012-04-12 11:44:02','2012-04-12 11:44:02',14,4,'1>>2>>3>>4>>14'),(17,'Sequential Output & Mgmt',NULL,'range','1 - 5','YOURCHILD can take things apart and put them back together easily.','2012-04-12 11:44:03','2012-04-12 11:44:03',14,4,'1>>2>>3>>4>>14'),(18,'Sequential Output & Mgmt',NULL,'range','1 - 5','YOURCHILD always does things one-step at a time.','2012-04-12 11:44:04','2012-04-12 11:44:04',14,4,'1>>2>>3>>4>>14'),(19,'Sequential Output & Mgmt',NULL,'range','1 - 5','YOURCHILD likes to make lists.','2012-04-12 11:44:05','2012-04-12 11:44:05',14,4,'1>>2>>3>>4>>14'),(20,'Memory',NULL,NULL,NULL,'YOURCHILD seems to have a near photographic memory. HE/SHE remembers things that surprise me.','2012-04-12 11:44:06','2012-04-12 11:44:06',4,3,'1>>2>>3>>4'),(21,'Short Term',NULL,'range','1 - 5','YOURCHILD is good at short-term memory. He can register new information like a phone number, use it to dial and then forget it.','2012-04-12 11:44:08','2012-04-12 11:44:08',20,4,'1>>2>>3>>4>>20'),(22,'Active Working',NULL,'range','1 - 5','YOURCHILD has a good working memory. HE/SHE can keep a conversation going for a long time, holding on and coming back to important parts of the conversation and relating it to prior knowledge.','2012-04-12 11:44:08','2012-04-12 11:44:08',20,4,'1>>2>>3>>4>>20'),(23,'Long Term',NULL,'range','1 - 5','YOURCHILD seems to excel at long term memory. HE/SHE easily stores information or experiences and then can access them at will when needed.','2012-04-12 11:44:09','2012-04-12 11:44:09',20,4,'1>>2>>3>>4>>20'),(24,'High Order Thinking',NULL,'range','1 - 5','YOURCHILD is knows how to think things through. HE/SHE is both a creative and critical thinker who can solve problems','2012-04-12 11:44:09','2012-04-12 11:44:09',3,2,'1>>2>>3'),(25,'Creative/Generative Thinking',NULL,'range','1 - 5','YOURCHILD can easily come up with novel and interesting ideas. HE/SHE can free-associate, free up HIS/HER mind to go off on original tangents.','2012-04-12 11:44:10','2012-04-12 11:44:10',24,3,'1>>2>>3>>24'),(26,'Critical/ Analytical Thinking',NULL,'range','1 - 5','YOURCHILD enjoys carving ideas up into their basic elements and parts. HE/SHE can find a compelling way of organizing any topic or problem.','2012-04-12 11:44:10','2012-04-12 11:44:10',24,3,'1>>2>>3>>24'),(27,'Diagnosis',NULL,'range','1 - 5','YOURCHILD  is good at making a diagnosis of a complex situation by identifying relevant factors and seeking causal explanations','2012-04-12 11:44:10','2012-04-12 11:44:10',26,4,'1>>2>>3>>24>>26'),(28,'Planning',NULL,'range','1 - 5','YOURCHILD can make a plan by figuring out the steps to complete a project.','2012-04-12 11:44:11','2012-04-12 11:44:11',26,4,'1>>2>>3>>24>>26'),(29,'Causation',NULL,'range','1 - 5','YOURCHILD can detect what has caused a sequence of events to occur by relying upon a case base of similar situations','2012-04-12 11:44:11','2012-04-12 11:44:11',26,4,'1>>2>>3>>24>>26'),(30,'Judgment',NULL,'range','1 - 5','YOURCHILD is good at using evidence to determine what is true or false, right or wrong.','2012-04-12 11:44:12','2012-04-12 11:44:12',26,4,'1>>2>>3>>24>>26'),(31,'Practical Problem-Solving',NULL,'range','1 - 5','YOURCHILD is good at coming up with practical solutions to problems.','2012-04-12 11:44:12','2012-04-12 11:44:12',24,3,'1>>2>>3>>24'),(32,'Investigating',NULL,'range','1 - 5','YOURCHILD is good at finding out for oneself what works and what doesnâ€™t by asking questions, conducting experiments and investigations','2012-04-12 11:44:12','2012-04-12 11:44:12',31,4,'1>>2>>3>>24>>31'),(33,'Investigating',NULL,'range','1 - 5','YOURCHILD is good at following step by step detailed instructions; or making a plan for a work project?','2012-04-12 11:44:13','2012-04-12 11:44:13',31,4,'1>>2>>3>>24>>31'),(34,'Evaluating',NULL,'range','1 - 5','YOURCHILD  enjoys identifying strengths, weaknesses and limitations of an argument or explanation','2012-04-12 11:44:13','2012-04-12 11:44:13',31,4,'1>>2>>3>>24>>31'),(35,'Developing Solutions',NULL,'range','1 - 5','YOURCHILD enjoys designing and creating things or coming up with interesting explanations for how things happened.','2012-04-12 11:44:14','2012-04-12 11:44:14',31,4,'1>>2>>3>>24>>31'),(36,'Meta Cognitive Reasoning',NULL,'range','1 - 5','YOURCHILD has an amazing ability to think about HIS/HER thinking, sometimes called \"mindfulness\". HE/SHE seems amazingly wise and mature for his age.','2012-04-12 11:44:14','2012-04-12 11:44:14',3,2,'1>>2>>3'),(37,'Mindsight',NULL,'range','1 - 5','YOURCHILD is good at managing his awareness of what\'s happening inside his mind-- his inside world of thoughts, emotions, intuitions.','2012-04-12 11:44:14','2012-04-12 11:44:14',36,3,'1>>2>>3>>36'),(38,'Learning to Learn',NULL,'range','1 - 5','YOURCHILD is good at learners to extend and master their own capacities for learning. HE/SHE is explicit and','2012-04-12 11:44:15','2012-04-12 11:44:15',36,3,'1>>2>>3>>36'),(39,'Willpower/ Self Mastery',NULL,'range','1 - 5','YOURCHILD is good at saying No when HE/SHE needs to, and Yes when HE/SHE needs to say yes and has the ability to distinguish what really matters.','2012-04-12 11:44:15','2012-04-12 11:44:15',36,3,'1>>2>>3>>36'),(40,'Social Reasoning',NULL,'Range','1. Not Like YOURCHILD At All   2. A Little Like YOURCHILD,  3. Somewhat Like YOURCHILD, 4. Mostly Like YOURCHILD, 5.  Very Much Like YOURCHILD,','YOURCHILD enjoys social events like parties.','2012-04-12 11:44:16','2012-04-12 11:44:16',2,1,'1>>2'),(41,'Empathy',NULL,NULL,'1 - 5','YOURCHILD is sensitive to the moods and feelings of others','2012-04-12 11:44:16','2012-04-12 11:44:16',40,2,'1>>2>>40'),(42,'Understanding Others',NULL,NULL,'1 - 5','YOURCHILD is interested in why people do the things they do.','2012-04-12 11:44:16','2012-04-12 11:44:16',41,3,'1>>2>>40>>41'),(43,'Revealing Shared Feeling/ Understanding',NULL,NULL,'1 - 5','YOURCHILD can make others feel understood or feel HIS/HER genuine concern','2012-04-12 11:44:17','2012-04-12 11:44:17',41,3,'1>>2>>40>>41'),(44,'Interaction Skills',NULL,NULL,'1 - 5','YOURCHILD gravitates toward other people and enjoys interacting with them','2012-04-12 11:44:17','2012-04-12 11:44:17',40,2,'1>>2>>40'),(45,'Listeniing',NULL,NULL,'1 - 5','YOURCHILD finds it easy to listen to others with HIS/HER full attention','2012-04-12 11:44:17','2012-04-12 11:44:17',44,3,'1>>2>>40>>44'),(46,'Sharing',NULL,NULL,'1 - 5','YOURCHILD finds it easy to explain to others.','2012-04-12 11:44:18','2012-04-12 11:44:18',44,3,'1>>2>>40>>44'),(47,'Influencing',NULL,NULL,'1 - 5','YOURCHILD can persuade his playdate/ friend to do the activity HE/SHE wants','2012-04-12 11:44:19','2012-04-12 11:44:19',44,3,'1>>2>>40>>44'),(48,'N