INSERT INTO `questions` VALUES (1723,'Social','My baby cries and I respond by trying to figure out what #he/she# needs- food, warmth, a clean diaper, a hug, etc.',0,'2012-04-05 14:50:14','2012-04-05 14:50:14',NULL),(1724,'Social','My baby smiles sometimes when #he/she# is sleeping. #His/Her# mouth turns up a little at the corners, but #his/her# eyes don\'t crinkle like mine do when I smile. Still, #he/she# looks like #he/she# is sleeping comfortably.',0,'2012-04-05 14:50:14','2012-04-05 14:50:14',NULL),(1725,'Social','My baby and I seem to influence each other. When #he/she# stops sucking, it makes me want to jiggle the nipple. When I jiggle, #he/she# starts sucking again. We usually fit well like that with each other.',1,'2012-04-05 14:50:14','2012-04-05 14:50:14',NULL),(1726,'Social','My baby cries sometimes when #he/she# hears other babies crying.',1,'2012-04-05 14:50:14','2012-04-05 14:50:14',NULL),(1727,'Social','My baby smiles at familiar faces and things, like the faces of family members or her mobile.',2,'2012-04-05 14:50:14','2012-04-05 14:50:14',NULL),(1728,'Social','My baby likes to play games with me when we are close. ##He/She## makes sounds after I make sounds. I usually try to figure out when my baby wants to play like this and when #he/she# needs to take a break and have some quiet time.',3,'2012-04-05 14:50:14','2012-04-05 14:50:14',NULL),(1729,'Social','My baby prefers to look at my familiar face more than at unfamiliar faces.',3,'2012-04-05 14:50:14','2012-04-05 14:50:14',NULL),(1730,'Social','My baby smiles at me more than at other people. We have a very special relationship.',4,'2012-04-05 14:50:14','2012-04-05 14:50:14',NULL),(1731,'Social','My baby seems interested in #himself/herself# as a separate person. ##He/She## looks curiously at #his/her# reflection in the mirror, although it doesn\'t seem like #he/she# knows the image is of #him/her#.',4,'2012-04-05 14:50:15','2012-04-05 14:50:15',NULL),(1732,'Social','My baby is uncomfortable around strangers. ##He/She## looks very carefully at new people. ##He/She## especially doesn\'t like if a stranger looks straight at #him/her# for a long time or for more than half a minute. ##He/She## will become upset and then cry.',5,'2012-04-05 14:50:15','2012-04-05 14:50:15',NULL),(1733,'Social','Once my baby becomes familiar with people, #he/she# remembers them and seems to recognize their face. After meeting my friends just a few times, #he/she# seems much more comfortable with them.',5,'2012-04-05 14:50:15','2012-04-05 14:50:15',NULL),(1734,'Social','My baby pays attention for a long time, so we can play lots of games together and interact by exchanging eye contact, smiles, and laughter. When I smile, #he/she# smiles back. When #he/she# laughs, I can\'t help but laugh also. We have such a good time together.',7,'2012-04-05 14:50:15','2012-04-05 14:50:15',NULL),(1735,'Social','My baby has learned behaviors of specific people. ##He/She## likes to play peekaboo with me more than with anyone else and So big!\" is a game #he/she# always plays with #his/her# aunt.\"',6,'2012-04-05 14:50:15','2012-04-05 14:50:15',NULL),(1736,'Social','My baby seems curious when other kids are upset. If other babies cry, my baby will look interested and might even reach out and touch them.',6,'2012-04-05 14:50:15','2012-04-05 14:50:15',NULL),(1737,'Social','My baby seems to have a specific attachment to me and favors me over other people. For example, #he/she# stops crying only when I pick #him/her# up and smiles and squeals with more excitement when I lean over to pick her up than when others do.',7,'2012-04-05 14:50:15','2012-04-05 14:50:15',NULL),(1738,'Social','My baby is afraid of strangers. #He/she# cries if a stranger comes close, especially if the stranger moves in quickly, if my baby can\'t see me, or if I look worried.',7,'2012-04-05 14:50:16','2012-04-05 14:50:16',NULL),(1739,'Social','My baby looks at me when #he/she# is unsure about something, such as a new person or crawling up more than a few stairs.',7,'2012-04-05 14:50:16','2012-04-05 14:50:16',NULL),(1740,'Social','My baby imitates me. If I do something, like tap on #his/her# cup with a plastic fork, #he/she# might pick up the fork and tap on the cup just like I did.',8,'2012-04-05 14:50:16','2012-04-05 14:50:16',NULL),(1741,'Social','My baby doesn\'t like to be separated from me. ##He/She## cries when I leave the room.',8,'2012-04-05 14:50:16','2012-04-05 14:50:16',NULL),(1742,'Social','My child knows that #he/she# can share #his/her# emotions with me. For example, #he/she# notices when we\'re both laughing. When something is funny to #him/her#, #he/she# looks to see if I think it\'s funny, too.',9,'2012-04-05 14:50:16','2012-04-05 14:50:16',NULL),(1743,'Social','My child has developed ways to cope with problem situations. For example, if #he/she# is frightened of a stranger, #he/she# hides behind my legs.',9,'2012-04-05 14:50:16','2012-04-05 14:50:16',NULL),(1744,'Social','My child frequently looks to me when #he/she# is unsure of something, and #he/she# is influenced by my reactions. For example, if a new toy seems scary, my child looks at me and, if I smile, #he/she# goes over to it and slowly explores it, looking back at me every now and then.',10,'2012-04-05 14:50:17','2012-04-05 14:50:17',NULL),(1745,'Social','My child gets distressed when #he/she# sees others in distress. For example, #he/she# gets upset when I am upset.',10,'2012-04-05 14:50:17','2012-04-05 14:50:17',NULL),(1746,'Social','My child will explore if I am nearby. When we\'re at the playground, my child may wander far from me, but every now and then #he/she# comes over to sort of check in with me.',12,'2012-04-05 14:50:17','2012-04-05 14:50:17',NULL),(1747,'Social','My child shares #his/her# emotions with me. ##He/She## gets very excited at the toy store and wants to show me everything. If I\'m not looking, #he/she# calls for me impatiently. It seems like half of #his/her# excitement is just knowing I\'m looking with #him/her#.',12,'2012-04-05 14:50:17','2012-04-05 14:50:17',NULL),(1748,'Social','My child doesn\'t play with other kids, but #he/she# often plays near other kids and with the same kind of things.',12,'2012-04-05 14:50:17','2012-04-05 14:50:17',NULL),(1749,'Social','My child loves when someone imitates what #he/she# is doing.',12,'2012-04-05 14:50:17','2012-04-05 14:50:17',NULL),(1750,'Social','My child seems to be concerned with social rules. For example, #he/she# will go near something #he/she# isn\'t supposed to touch and hold #his/her# hand over it, saying, No no no.\"  ##He/She## is also concerned when things aren\'t where they should be or when things are broken.',15,'2012-04-05 14:50:17','2012-04-05 14:50:17',NULL),(1751,'Social','My child sometimes plays with other kids but often plays by #himself/herself#. If #he/she# plays with another child, #he/she# often copies what another child is doing or watches as other children copy #him/her#.',15,'2012-04-05 14:50:17','2012-04-05 14:50:17',NULL),(1752,'Social','My child gets extremely upset when I leave, kicking, screaming, and crying so much that I feel terrible and dread having to leave even for a short time.',15,'2012-04-05 14:50:17','2012-04-05 14:50:17',NULL),(1753,'Social','My child seems to be testing me. ##He/She## will attempt do something I\'ve told #him/her# not to do, the whole time looking at me with a sneaky grin.',18,'2012-04-05 14:50:17','2012-04-05 14:50:17',NULL),(1754,'Social','My child recognizes that #he/she# is a separate individual and #he/she# does things that show me he/she# has this sense of self. For example, when we play hide-n-seek, #he/she# knows that #he/she# needs to hide #his/her# whole body so that I cannot see #him/her#.',18,'2012-04-05 14:50:18','2012-04-05 14:50:18',NULL),(1755,'Social','My child often ignores other children when they are upset, but #he/she# will occasionally reach out and give a gentle pat on the back when a playmate is crying.',18,'2012-04-05 14:50:18','2012-04-05 14:50:18',NULL),(1756,'Social','My child plays interactively with other children. For example, #he/she# will run and chase another child, who then runs and chases my child back.',21,'2012-04-05 14:50:18','2012-04-05 14:50:18',NULL),(1757,'Social','My child is learning what is and is not acceptable. ##He/She## uses the words good\" and \"bad\" and will ask me if #he/she# has done something bad.\"',21,'2012-04-05 14:50:18','2012-04-05 14:50:18',NULL),(1758,'Social','My child sometimes makes excuses when #he/she# does something #he/she#\'s not supposed to do. ##He/She## will deny it by saying, Not me!\" or blame another person.\"',24,'2012-04-05 14:50:19','2012-04-05 14:50:19',NULL),(1759,'Social','My child can talk about #his/her# feelings. ##He/She## can also figure out how I\'m feeling. If I\'m looking angry, #he/she# may come over to me and ask, Mommy mad?\"\"',24,'2012-04-05 14:50:19','2012-04-05 14:50:19',NULL),(1760,'Social','My child often asserts #himself/herself#. For example, #he/she# refuses to do many of the things I ask #him/her# to do and #he/she# seems to want to have #his/her# own way much of the time.',27,'2012-04-05 14:50:19','2012-04-05 14:50:19',NULL),(1761,'Social','My child has special relationships with certain people. For instance, #he/she# has a tradition with #his/her# grandfather. Only grandpa can make Sunday morning French toast.',27,'2012-04-05 14:50:19','2012-04-05 14:50:19',NULL),(1762,'Social','My child likes to play in a very social, pretend kind of way often involving routines from our everyday life. ##He/She## especially likes when #he/she# plays the parent and I am the baby. ##He/She## tells me to say, \"goo goo ga ga\"  while #he/she# pats me on the back and says, \"There there baby\".',30,'2012-04-05 14:50:19','2012-04-05 14:50:19',NULL),(1763,'Social','My child often questions the rules I make. ##He/She## will ask me why #he/she# has to do things, like go to bed when it\'s still light out. If I don\'t give in, #he/she# might try to make a deal with me like, I\'ll stay up only for five more minutes  or pout and threaten me by saying something like, \"You\'re not my friend!\"',30,'2012-04-05 14:50:19','2012-04-05 14:50:19',NULL),(1764,'Social','My child is learning what is in my mind, like what I know and what I don\'t know. ##He/She## makes me guess what\'s in #his/her# hand until I figure it out. ##He/She## knows I don\'t know what it is because #he/she# hasn\'t shown me yet.',33,'2012-04-05 14:50:19','2012-04-05 14:50:19',NULL),(1765,'Social','My child is developing friendships. ##He/She## mentions one or two kids over and over when I ask who #he/she# plays with at preschool. ##He/She## likes to do a lot of the things those kids like to do, like pretend to be Batman and Robin. ##He/She## doesn\'t seem to spend a lot of time with kids who do other things that don\'t interest #him/her# as much.',33,'2012-04-05 14:50:21','2012-04-05 14:50:21',NULL),(1766,'Social','My child can be caring when someone is upset, especially someone he knows well like a friend or someone in our family.',36,'2012-04-05 14:50:21','2012-04-05 14:50:21',NULL),(1767,'Social','My child seems to know and can reason about whether #he/she# did something by accident or meant to do it. For example, if #he/she# spills juice by accident, #he/she# says, \"sorry--didn\'t mean it!\" right away. But if #he/she# does something like pinch another child in anger  #he/she# does not say \"sorry\" right away and tries to explain why #he/she# did it when I ask #him/her# about it.',36,'2012-04-05 14:50:21','2012-04-05 14:50:21',NULL),(1768,'Social','My child pretend plays in a way that involves a lot of negotiation of the roles and the action. For example, #he/she# will tell #his/her# friend that they have to put out a fire, so #he/she# will get the water hose and #his/her# friend should try to save the people in the building. They may change the plan if one of them wants to do something in a different way.',42,'2012-04-05 14:50:22','2012-04-05 14:50:22',NULL),(1769,'Social','My child knows that #he/she# can mislead me and make me believe something that isn\'t true. ##He/She## will sometimes tell me something is so when it really isn\'t, so #he/she# can get what #he/she# wants. For example, #he/she# will tell me that grandma said #he/she# could have ice cream, when really grandma said no such thing.',42,'2012-04-05 14:50:22','2012-04-05 14:50:22',NULL),(1770,'Social','My child seems to know and can reason about whether others did something by accident or meant to do it. For example, if I forget to buy #his/her# favorite cereal, #he/she# doesn\'t get mad at me if I say it was an accident. But, if I tell #him/her# that I meant not to get it because I thought it was bad for #him/her#, my child gets very angry.',48,'2012-04-05 14:50:22','2012-04-05 14:50:22',NULL),(1771,'Social','My child sometimes shares things with #his/her# friends. ##He/She## often shares #his/her# snacks, but #he/she# doesn\'t like to share #his/her# toys as much.',48,'2012-04-05 14:50:23','2012-04-05 14:50:23',NULL),(1772,'Physical','My baby moves in ways that seem automatic, like a reflex. For example, when I gently stroke #his/her# cheek, #he/she# turns toward my finger and tries to suck on it.',0,'2012-04-05 14:50:23','2012-04-05 14:50:23',NULL),(1773,'Physical','My baby seems to like when I help #him/her# control #his/her# body movements. If #he/she# is fussy and #his/her# arms are flailing around, #he/she# appears to become more content when I swaddle #him/her# snugly in a blanket.',0,'2012-04-05 14:50:23','2012-04-05 14:50:23',NULL),(1774,'Physical','My baby has some control over #his/her# neck muscles. #He/She# can turn #his/her# head and hold #his/her# chin up. But, I need to provide neck support when I lift #him/her#.',1,'2012-04-05 14:50:23','2012-04-05 14:50:23',NULL),(1775,'Physical','My baby often kicks #his/her# legs like a frog, especially when #he/she# is excited.',1,'2012-04-05 14:50:23','2012-04-05 14:50:23',NULL),(1776,'Physical','My baby\'s shoulder muscles have developed so that #he/she# can push #his/her# chest up off the floor with #his/her# arms.',2,'2012-04-05 14:50:23','2012-04-05 14:50:23',NULL),(1777,'Physical','My baby seems to have some set movements of #his/her# body. If I hold #his/her# so that #he/she# is tilted to the side, front, or back, #he/she# will try to keep #his/her# head upright. If I place #him/her# on her tummy with #his/her# head turned to the side, #he/she# tends to turn #his/her# body to be in the same direction as #his/her# head.',2,'2012-04-05 14:50:24','2012-04-05 14:50:24',NULL),(1778,'Physical','My baby can roll #his/her# body over in one direction.',3,'2012-04-05 14:50:24','2012-04-05 14:50:24',NULL),(1779,'Physical','My baby grasps things that I put in #his/her# hand. ##He/She## uses #his/her# whole hand, not just a few fingers, to pick up small things. And, #he/she# doesn\'t use #his/her# thumb the way I do, like when I grasp something with my fingers on one side and my thumb on the opposite side. Once #he/she# has grasped something I put in #his/her# hand, #he/she# seems to have trouble letting go.',3,'2012-04-05 14:50:25','2012-04-05 14:50:25',NULL),(1780,'Physical','My baby reaches out to swipe at things, but often misses.',3,'2012-04-05 14:50:25','2012-04-05 14:50:25',NULL),(1781,'Physical','My baby pays a lot of attention to things that move, like mobiles and people and even her own hands.',3,'2012-04-05 14:50:26','2012-04-05 14:50:26',NULL),(1782,'Physical','My baby can sit up with my support.',4,'2012-04-05 14:50:26','2012-04-05 14:50:26',NULL),(1783,'Physical','My baby can reach toward something #he/she# is looking at. Sometimes, #he/she# even touches what #he/she# was looking at!',4,'2012-04-05 14:50:26','2012-04-05 14:50:26',NULL),(1784,'Physical','My baby visually directs the way #he/she# reaches. ##He/She## can touch or grasp things #he/she# reaches out for, not just things I place in #his/her# hand. ##He/She## grasps and lifts things by pushing them with #his/her# fingers against #his/her# palm although #his/her# grasp is still a bit unsteady.',4,'2012-04-05 14:50:26','2012-04-05 14:50:26',NULL),(1785,'Physical','My baby tries to stand when I hold #him/her# under #his/her# arms and #his/her# feet touch the floor. ##He/She## tries to straighten #his/her# legs, tensing #his/her# leg muscles.',5,'2012-04-05 14:50:26','2012-04-05 14:50:26',NULL),(1786,'Physical','My baby uses #his/her# whole hand to grasp things, lifting things by pushing them with #his/her# fingers against #his/her# palm.',5,'2012-04-05 14:50:26','2012-04-05 14:50:26',NULL),(1787,'Physical','My baby sits alone, but #he/she# leans forward a lot and sometimes uses #his/her# hands for support. ',6,'2012-04-05 14:50:26','2012-04-05 14:50:26',NULL),(1788,'Physical','My baby grasps with #his/her# whole hand, using #his/her# thumb separately to hold things like someone wearing a mitten. #He/She# has difficulty letting go of things #he/she# is holding.',6,'2012-04-05 14:50:26','2012-04-05 14:50:26',NULL),(1789,'Physical','My baby is trying to crawl. #He/She# often pushes up on #his/her# hands and knees and rocks back and forth. Sometimes, #he/she# uses #his/her# arms to pull #himself/herself# along the floor and #his/her# toes or knees to push.',6,'2012-04-05 14:50:27','2012-04-05 14:50:27',NULL),(1790,'Physical','My baby crawls.',7,'2012-04-05 14:50:27','2012-04-05 14:50:27',NULL),(1791,'Physical','My baby stands for a short time when I support #him/her# or #he/she# holds on to something. #He/She# seems to lean a lot on me or whatever is supporting #him/her#.',7,'2012-04-05 14:50:27','2012-04-05 14:50:27',NULL),(1792,'Physical','My baby crawls efficiently. #He/She# is pretty quick and #his/her# movements are well coordinated.',8,'2012-04-05 14:50:27','2012-04-05 14:50:27',NULL),(1793,'Physical','My baby grasps things using #his/her# fingers together in opposition to #his/her# thumb, like in a scissors motion.',8,'20