 adjust #his/her# grasp as I hand #him/her# a hammer so that #his/her# hand fits firmly in the place that will help #him/her# balance it well.',27,'2012-04-05 14:50:31','2012-04-05 14:50:31',NULL),(1820,'Physical','My child throws a ball by extending #his/her# forearm and keeping #his/her# upper arm horizontal and still. #He/She# stands stationary when throwing, not moving forward, and #he/she# usually aims at a target, like a person who is trying to catch the ball.',30,'2012-04-05 14:50:31','2012-04-05 14:50:31',NULL),(1821,'Physical','My child uses #his/her# motor skills and hand-finger coordination to help care for #himself/herself#. ##He/She## can unbutton #his/her# buttons if they are large and undress #himself/herself#. If I set up things for #him/her#, like a stepping stool and low hooks, my child can help put #his/her# clothes away and clean #himself/herself# in the bathroom.',30,'2012-04-05 14:50:31','2012-04-05 14:50:31',NULL),(1822,'Physical','My child catches a ball by holding #his/her# arms out straight in front of #him/her#, with #his/her# palms up. When the ball lands in #his/her# arms, #he/she# bends #his/her# elbows and tries to trap the ball against #his/her# chest. Sometimes, #he/she# turns #his/her# head to the side and leans back.',33,'2012-04-05 14:50:31','2012-04-05 14:50:31',NULL),(1823,'Physical','My child hits a moving ball by using an overhand strike. Sometimes, #he/she# swings early, right when the thrower lets the ball go.',36,'2012-04-05 14:50:31','2012-04-05 14:50:31',NULL),(1824,'Physical','My child has good control over #his/her# thumb so #he/she# can do lots of things, like hold scissors to snip a piece of paper, hold a pen to scribble, hold a fork with #his/her# fingers rather than in #his/her# fist, and put on #his/her# shoes.',36,'2012-04-05 14:50:32','2012-04-05 14:50:32',NULL),(1825,'Physical','My child uses #his/her# fine motor skills to paint and draw. ##He/She## draws up and down scribbles and round scribbles.',30,'2012-04-05 14:50:32','2012-04-05 14:50:32',NULL),(1826,'Physical','My child can hop about three times on one foot.',42,'2012-04-05 14:50:32','2012-04-05 14:50:32',NULL),(1827,'Physical','My child throws a ball by facing the target, keeping #his/her# feet in one place, and extending #his/her# forearm, turning #his/her# body before and after throwing.',42,'2012-04-05 14:50:32','2012-04-05 14:50:32',NULL),(1828,'Physical','My child holds a pencil similar to the way I do, with the pencil between the thumb and index finger, supported by the middle finger.',42,'2012-04-05 14:50:32','2012-04-05 14:50:32',NULL),(1829,'Physical','My child runs in a mature way with good speed.',48,'2012-04-05 14:50:32','2012-04-05 14:50:32',NULL),(1830,'Physical','My child can do a one-footed skip, but without rhythm.',48,'2012-04-05 14:50:32','2012-04-05 14:50:32',NULL),(1831,'Physical','My child uses #his/her# fine motor skills to draw shapes and simple figures.',48,'2012-04-05 14:50:32','2012-04-05 14:50:32',NULL),(1832,'Physical','My child has good hand-finger coordination and can button almost any button.',48,'2012-04-05 14:50:32','2012-04-05 14:50:32',NULL),(1833,'Visual','My baby seems to see things when I hold them close to #his/her# face, about 8 or so inches away. ##He/She## follows a toy or my hand as I move it slowly in front of #him/her#.',0,'2012-04-05 14:50:32','2012-04-05 14:50:32',NULL),(1834,'Visual','My baby\'s eye movements are jerky.',0,'2012-04-05 14:50:33','2012-04-05 14:50:33',NULL),(1835,'Visual','My baby seems to prefer to look at things with patterns. ##He/She## will stare at my shirt with the bold black and white design much longer than my solid-colored shirts.',0,'2012-04-05 14:50:33','2012-04-05 14:50:33',NULL),(1836,'Visual','My baby\'s eye movements are fairly smooth and controlled, not jerky.',1,'2012-04-05 14:50:33','2012-04-05 14:50:33',NULL),(1837,'Visual','My baby tends to look mostly at the outside of my face along my hairline, but #he/she# is attracted to the movement of my mouth when I speak.',1,'2012-04-05 14:50:33','2012-04-05 14:50:33',NULL),(1838,'Visual','My baby seems to pay particular attention to the edges of things, like where the light and dark meet at the edges of the window or my hairline.',2,'2012-04-05 14:50:33','2012-04-05 14:50:33',NULL),(1839,'Visual','My baby focuses on my eyes when my face is close to #his/hers#. I can\'t help but gaze into my baby\'s eyes in response.',2,'2012-04-05 14:50:33','2012-04-05 14:50:33',NULL),(1840,'Visual','My baby seems to pay a lot of attention to the details of my face. ##He/She## looks at my eyes, mouth, and nose.',3,'2012-04-05 14:50:33','2012-04-05 14:50:33',NULL),(1841,'Visual','My baby can see many colors, especially contrasting colors, like the red, blue, and yellow polka dots on #his/her# crib bumper.',3,'2012-04-05 14:50:34','2012-04-05 14:50:34',NULL),(1842,'Visual','My baby pays a lot of attention to things that move, like mobiles and people and even her own hands.',3,'2012-04-05 14:50:34','2012-04-05 14:50:34',NULL),(1843,'Visual','My baby can tell how far away things are. ##He/She## seems to reach for the dog\'s tail just about where it is.',4,'2012-04-05 14:50:34','2012-04-05 14:50:34',NULL),(1844,'Visual','My baby is very interested in new faces. ##He/She## stares intently when #he/she# sees a new face.',5,'2012-04-05 14:50:34','2012-04-05 14:50:34',NULL),(1845,'Visual','My baby will reach for a toy even when it is partially covered up by a blanket.',4,'2012-04-05 14:50:34','2012-04-05 14:50:34',NULL),(1846,'Visual','My baby can tell that one thing is farther away than another thing by noticing how one overlaps the other. ##He/She## reaches around one toy to get another toy.',6,'2012-04-05 14:50:34','2012-04-05 14:50:34',NULL),(1847,'Visual','My baby can judge the size of things, whether they are placed nearby or faraway. For example, #he/she# doesn\'t seem to have renewed interest in something if I move it farther away from #him/her#. It\'s like #he/she# knows it\'s the same thing no matter where it is.',7,'2012-04-05 14:50:34','2012-04-05 14:50:34',NULL),(1848,'Visual','My baby seems to be developing a fear of heights. ##He/She## holds on tight when I carry #him/her#.',7,'2012-04-05 14:50:34','2012-04-05 14:50:34',NULL),(1849,'Visual','My baby loves to look for objects I\'ve hidden and #he/she# will continue to look in the same hiding place that I\'ve used over and over again even when I move #his/her# toy to a new hiding place.',8,'2012-04-05 14:50:34','2012-04-05 14:50:34',NULL),(1850,'Visual','My child seems to know if something moving toward him/her# is human or not. For example  #he/she# will act differently depending on who is approaching #him/her#. If #he/she# is crying and a person comes closer  #he/she# will calm down  but if a dog or cat comes closer #he/she# will keep crying.',9,'2012-04-05 14:50:34','2012-04-05 14:50:34',NULL),(1851,'Visual','My child seems to know that the things around #him/her# stay in the same place even when #he/she# moves and is faced in a different direction. ##He/She## immediately finds the pictures on the refrigerator no matter where I face #his/her# highchair.',10,'2012-04-05 14:50:34','2012-04-05 14:50:34',NULL),(1852,'Visual','My child can focus #his/her# attention even when there are distractions around #him/her#. ##He/She## continues to look at and play with toys even when I am making a lot of noise nearby in the kitchen or #his/her# sister is acting out an action-packed drama with friends in the same room.',10,'2012-04-05 14:50:34','2012-04-05 14:50:34',NULL),(1853,'Visual','My child can figure out new ways of getting to where #he/she# wants to go. ##He/She## will go around a group of people in order to get to me.',12,'2012-04-05 14:50:34','2012-04-05 14:50:34',NULL),(1854,'Visual','My child can remember what size things are. ##He/She## would be able to tell if I took a big chunk of #his/her# cake from #his/her# plate because #he/she# can remember what size it was before!',12,'2012-04-05 14:50:35','2012-04-05 14:50:35',NULL),(1855,'Visual','My child scribbles on paper if I give #him/her# some crayons. ##He/She## makes different kinds of scribbles, usually overlapping each other but with no particular pattern.',15,'2012-04-05 14:50:35','2012-04-05 14:50:35',NULL),(1856,'Visual','My child seems to prefer shapes rather than colors. For example, when I give #him/her# some colored shapes, #he/she# tends to sort them by color-all the blue shapes together, all the reds together, etc. ',15,'2012-04-05 14:50:35','2012-04-05 14:50:35',NULL),(1857,'Visual','Usually my child pays attention to the television if I turn it on, but it\'s not uncommon for #him/her# to wander off and play with toys, rather than focusing on the program for a long time.',18,'2012-04-05 14:50:35','2012-04-05 14:50:35',NULL),(1858,'Visual','My child can judge the size of objects, no matter if they are placed nearby or far away. For example, #he/she# knows exactly which is the big Pooh bear #his/her# aunt gave #him/her#, even if it is farther away and appears smaller than #his/her# brother\'s small Pooh bear.',18,'2012-04-05 14:50:35','2012-04-05 14:50:35',NULL),(1859,'Visual','My child seems to be scribbling drawings of things that move. ##He/She##  makes the sound of a car when #he/she# draws long lines.',21,'2012-04-05 14:50:35','2012-04-05 14:50:35',NULL),(1860,'Visual','My child can find things that #he/she# wants.  ##He/She## can figure out where I put the toys #he/she# isn\'t allowed to play with.',21,'2012-04-05 14:50:35','2012-04-05 14:50:35',NULL),(1861,'Visual','My child is drawing a lot of designs, like curvy lines, zig-zags, and looping lines. ##He/She## seems to draw designs in particular places on the paper.',24,'2012-04-05 14:50:35','2012-04-05 14:50:35',NULL),(1862,'Visual','My child can figure out the layout of a new area just by looking around for a little while. When we go to a friend\'s home for the first time, #he/she# adjusts quickly and seems to find #his/her# way around easily after we\'ve gotten the tour.',24,'2012-04-05 14:50:35','2012-04-05 14:50:35',NULL),(1863,'Visual','My child labels #his/her# scribbles after #he/she# draws them on paper. ##He/She## will draw a shape and then call it the sun.',27,'2012-04-05 14:50:35','2012-04-05 14:50:35',NULL),(1864,'Visual','My child makes towers and rows with #his/her# building blocks.',27,'2012-04-05 14:50:35','2012-04-05 14:50:35',NULL),(1865,'Visual','My child is experimenting with colors. ##He/She## tries out different colors and mixes some colors together when #he/she# paints.',30,'2012-04-05 14:50:35','2012-04-05 14:50:35',NULL),(1866,'Visual','My child is beginning to make marks on paper that #he/she# says is writing.',30,'2012-04-05 14:50:35','2012-04-05 14:50:35',NULL),(1867,'Visual','My child sometimes draws a picture of a circle with a tail, sort of like a tadpole. ',33,'2012-04-05 14:50:35','2012-04-05 14:50:35',NULL),(1868,'Visual','My child can retrace #his/her# steps in the opposite direction #he/she# goes. ##He/She## can direct us from the children\'s room at the library to where we check out #his/her# books.',33,'2012-04-05 14:50:35','2012-04-05 14:50:35',NULL),(1869,'Visual','My child makes many different shapes out of playdough. ##He/She## rolls the playdough into balls or long snakes and sometimes pats the playdough into a pancake, adding spots #he/she# says are the eyes, nose, and mouth. My child also shapes the playdough so that it can stand up and tells me which parts are the legs and arms.',36,'2012-04-05 14:50:36','2012-04-05 14:50:36',NULL),(1870,'Visual','My child has a definite idea of what is the top and bottom of something. When #he/she# gives me #his/her# drawing to look at, #he/she# tells me how to hold it if #he/she# thinks I\'m holding it the wrong way. ',36,'2012-04-05 14:50:36','2012-04-05 14:50:36',NULL),(1871,'Visual','My child can tell what things look like from where I am. If I pretend I don\'t know where #he/she# is when we play hide-n-seek, #he/she# says things like, Look around the chair!\" or \"Look under the table!\"\"',42,'2012-04-05 14:50:36','2012-04-05 14:50:36',NULL),(1872,'Visual','My child makes things with building blocks. ##He/She## sometimes makes bridges by connecting two tall blocks with a block across the top. ##He/She## also uses blocks to make a fence for #his/her# toy farm animals or a garage to hold #his/her# cars.',42,'2012-04-05 14:50:36','2012-04-05 14:50:36',NULL),(1873,'Visual','My child makes drawings that show things normally hidden. When drawing a picture of a person wearing clothes, my child will draw the body first and then the clothes so that you can still see the stomach and arms and legs underneath.',48,'2012-04-05 14:50:36','2012-04-05 14:50:36',NULL),(1874,'Visual','My child seems to have a mental picture of the layout of a room. When I vacuum, moving some of the small furniture out of the room, my child is able to put many of the pieces back where they belong.',48,'2012-04-05 14:50:37','2012-04-05 14:50:37',NULL),(1875,'Language','My baby cries and fusses, and I respond by trying to figure out what #he/she# needs  food, a clean diaper, a hug, etc. ',0,'2012-04-05 14:50:37','2012-04-05 14:50:37',NULL),(1876,'Language','My baby makes cooing sounds (ah and oo) and some laughing sounds (ge ge or yeh yeh) when I talk to or touch her. ',2,'2012-04-05 14:50:37','2012-04-05 14:50:37',NULL),(1877,'Language','My baby\'s attention seems to be drawn to my voice and the voices of other people who take care of her more than to the voices of strangers. ',0,'2012-04-05 14:50:37','2012-04-05 14:50:37',NULL),(1878,'Language','My baby holds my gaze and smiles when I look at her. ',2,'2012-04-05 14:50:37','2012-04-05 14:50:37',NULL),(1879,'Language','My baby seems to prefer being spoken to in a high-pitched baby talk voice rather than my regular voice. I can tell because #he/she# looks at me, smiles and wiggles more when I use baby talk. ',4,'2012-04-05 14:50:37','2012-04-05 14:50:37',NULL),(1880,'Language','My baby makes a lot of different kinds of sounds, including cries, whimpers, and squeaks. ',3,'2012-04-05 14:50:38','2012-04-05 14:50:38',NULL),(1881,'Language','My baby seems to delight in making eye-contact with me. ##He/She## enjoys it when we look into each other\'s eyes and smile and coo back and forth at each other, as if we are having a conversation.',2,'2012-04-05 14:50:38','2012-04-05 14:50:38',NULL),(1882,'Language','My baby is beginning to play with sounds, seeing what #he/she# can do with her mouth. It\'s not cooing but it doesn\'t have the repetitious quality of babbling yet either.',4,'2012-04-05 14:50:38','2012-04-05 14:50:38',NULL),(1883,'Language','My baby is beginning to babble, using recognizable, repeatable sounds like da da and ba ba!',5,'2012-04-05 14:50:38','2012-04-05 14:50:38',NULL),(1884,'Language','My baby responds to sounds I make for him by widening his eyes, cooing, smiling, etc.',3,'2012-04-05 14:50:38','2012-04-05 14:50:38',NULL),(1885,'Language','My baby uses objects to communicate with me. For instance, #he/she# holds things up for me to see and then looks to see if I\'m looking at them.',6,'2012-04-05 14:50:38','2012-04-05 14:50:38',NULL),(1886,'Language','My baby is using gestures and crying to let me know when #he/she# is frustrated or afraid of new people, objects or events. For example, #he/she# may hold her arms up to let me know #he/she# wants to be picked up.',6,'2012-04-05 14:50:38','2012-04-05 14:50:38',NULL),(1887,'Language','My baby seems to love to string sounds together and repeat them over and over. For instance, #he/she# may say, abi, abi or adibaba in a playful and even melodic way. ',8,'2012-04-05 14:50:38','2012-04-05 14:50:38',NULL),(1888,'Language','My baby seems to understand some simple words. For instance, #he/she# may respond to my \"No\" by stopping what #he/she# is doing and looking at me or #he/she# may smile in recognition when I say the cat\'s name.',7,'2012-04-05 14:50:38','2012-04-05 14:50:38',NULL),(1889,'Language','My child has begun to use gestures to communicate with me. For example, #he/she# will push an unwanted bowl away or hold a toy up as if to show it to me. ',9,'2012-04-05 14:50:38','2012-04-05 14:50:38',NULL),(1890,'Language','My child seems to be using her own made-up words. For example, #he/she# says abab and points to the dog every time #he/she# enters the room.',9,'2012-04-05 14:50:39','2012-04-05 14:50:39',NULL),(1891,'Language','My child\'s babbling sounds expressive because it goes up and down in pitch. For example, a sentence may go up at the end to make it sound like a question for me: Aba bibaba?',10,'2012-04-05 14:50:39','2012-04-05 14:50:39',NULL),(1892,'Language','My child is using a great variety of gestures as #he/she# speaks. For instance, #he/she# may point a finger to indicate things #he/she# wants or notices, blow to show something is too hot, wave while saying bye-bye, etc.',12,'2012-04-05 14:50:39','2012-04-05 14:50:39',NULL),(1893,'Language','My child is using her first words! ##He/She## says simple words like ball, hot, no and me.',10,'2012-04-05 14:50:39','2012-04-05 14:50:39',NULL),(1894,'Language','My child seems to understand sentences of several words, such as Do you want a cookie?\" or \"Where is your bellybutton?\" \"',12,'2012-04-05 14:50:39','2012-04-05 14:50:39',NULL),(1895,'Language','My child uses one word sentences that pack a lot of meaning. For example, he\'ll say Dog!\" to tell me #he/she# wants to cross the street to pet a dog.\"',15,'2012-04-05 14:50:39','2012-04-05 14:50:39',NULL),(1896,'Language','When #he/she# says \"Want!\" I scramble to figure out what exactly it is that #he/she# wants.',10,'2012-04-05 14:50:39','2012-04-05 14:50:39',NULL),(1897,'Language','My child\'s gestures have gotten quite numerous and sophisticated. ##He/She## may shrug her shoulders to say, \"I don\'t know\",  put a cup to her lips to tell me #he/she# wants a drink, or pull on my pant leg to get me to go somewhere.',12,'2012-04-05 14:50:39','2012-04-05 14:50:39',NULL),(1898,'Language','My child tend to over use some words and under use others.  For instance, #he/she# stretches words to cover new things that #he/she# doesn\'t yet have a word for, such as using \"doggie\" to refer to a cow.  But at other times #he/she# uses words very narrowly such as using \"car\" to refer only to our red car and not any other.',15,'2012-04-05 14:50:40','2012-04-05 14:50:40',NULL),(1899,'Language','My child\'s behavior shows that #he/she# clearly understands common phrases. For instance, #he/she# sits in the right chair when I say, \"Go sit in your chair\" and when I say \"That\'s not a toy\" #he/she# either puts it down, runs away or whines at me.',12,'2012-04-05 14:50:40','2012-04-05 14:50:40',NULL),(1900,'Language','My child understands my gestures. For instance, #he/she# turns her head in the right direction when I point.',15,'2012-04-05 14:50:40','2012-04-05 14:50:40',NULL),(1901,'Language','My child is experiencing a little explosion in her vocabulary. ##He/She## seems to be learning several new words every day! ',18,'2012-04-05 14:50:40','2012-04-05 14:50:40',NULL),(1902,'Language','My child is creating her first two word sentences, such as No more\" and \"Kitty gone!\"\"',18,'2012-04-05 14:50:41','2012-04-05 14:50:41',NULL),(1903,'Language','My child seems to have conversations with himself on occasion. For instance, #he/she# may talk briefly to himself before falling asleep, or #he/she# remind himself not to do things like touch the hot stove by saying, \"Hot hot no touch hot\" as #he/she# stands in front of it.',21,'2012-04-05 14:50:41','2012-04-05 14:50:41',NULL),(1904,'Language','My child is into naming things, and often asks, What dat?\"\"',21,'2012-04-05 14:50:41','2012-04-05 14:50:41',NULL),(1905,'Language','My child is very interested in getting the right word for each object. ##He/She## seldom uses the wrong word to name things  that is, #he/she# doesn\'t use doggie for cats, cows and horses as well as dogs anymore.',21,'2012-04-05 14:50:43','2012-04-05 14:50:43',NULL),(1906,'Language','My child is learning the rules of grammar. I can tell because #he/she# is making grammatical errors with words #he/she# used to use correctly. For instance, #he/she# says goed instead of went, runned instead of ran and feets instead of feet.',24,'2012-04-05 14:50:44','2012-04-05 14:50:44',NULL),(1907,'Language','My child can figure out the meaning of words by listening to how they are used. For instance, when I said, You can pet the gerbil, #he/she# knew I meant the little animal in front of her even though #he/she# had never heard the word gerbil before.',24,'2012-04-05 14:50:44','2012-04-05 14:50:44',NULL),(1908,'Language','My child is amused when I misname something. ##He/She## laughs if I call her Pumpkinhead or point to the cat and say Daddy.',24,'2012-04-05 14:50:44','2012-04-05 14:50:44',NULL),(1909,'Language','My child asks a lot of questions that begin with who, what, when, where, how and especially why?!?.',27,'2012-04-05 14:50:44','2012-04-05 14:50:44',NULL),(1910,'Language','My child can hold a conversation with one person by taking turns at talking, but still has a hard time negotiating a conversation with or entering a conversation between two or more people.',27,'2012-04-05 14:50:44','2012-04-05 14:50:44',NULL),(1911,'Language','Instead of saying things like, Daddy no go, my child is using the more advanced form of negative sentences, such as, Daddy, don\'t go.',30,'2012-04-05 14:50:45','2012-04-05 14:50:45',NULL),(1912,'Language','My child can hand me the larger of two objects if I say, Give me the big one. ##He/She## also understand tall/short and long/short. ##He/She## struggles with other, less concrete comparisons however, such as old/young or deep/shallow.',30,'2012-04-05 14:50:46','2012-04-05 14:50:46',NULL),(1913,'Language','My child notices whether or not I understand her and will repeat herself if I don\'t.',33,'2012-04-05 14:50:46','2012-04-05 14:50:46',NULL),(1914,'Language','My child knows the difference between mine and yours ##He/She## is able to tell me and her playmates which things belong to her (even temporary possessions, as when #he/she# is playing with a toy at daycare) and which things belong to others. ',30,'2012-04-05 14:50:46','2012-04-05 14:50:46',NULL),(1915,'Language','My child asks me to repeat myself or clarify what I said when #he/she# doesn\'t understand me. Her requests for clarity range from a simple Huh? Or What? to more complex statements like, What do you want me to do?\"  \"',36,'2012-04-05 14:50:47','2012-04-05 14:50:47',NULL),(1916,'Language','My child is using silly language, especially with her playmates. ##He/She## seems to be testing the limits of absurdity by referring to unlikely events such as \"Mommy got stuck in the bathtub\" or poetic nonsense that includes outrageous names like Birdy Head.',42,'2012-04-05 14:50:47','2012-04-05 14:50:47',NULL),(1917,'Language','My child can adopt different voices. For instance, #he/she# uses the high-pitched tone of motherese when talking to a baby, and changes the tone and loudness of her voice when pretending to be a daddy. ',42,'2012-04-05 14:50:47','2012-04-05 14:50:47',NULL),(1918,'Language','My child can read or at least identify common words #he/she# sees around the house, like the name of the toothpaste on the toothpaste tube or the title of a well-loved book.',42,'2012-04-05 14:50:47','2012-04-05 14:50:47',NULL),(1919,'Language','My child is using polite terms and phrases. ##He/She## has been saying please and thank you for months, but now #he/she# is using more sophisticated polite forms such as, May I please have some candy?\" instead of just \"Candy please?\"',48,'2012-04-05 14:50:47','2012-04-05 14:50:47',NULL),(1920,'Language','My child uses if-then sentences. For example, #he/she# says, If it doesn\'t rain then we\'ll go to the park \".\"',48,'2012-04-05 14:50:47','2012-04-05 14:50:47',NULL),(1921,'Language','My child understands hints about polite behavior. When I say, \"Those are Grandpa\'s favorites\" #he/she# understands that I want her to give her grandfather some of her candy.',48,'2012-04-05 14:50:47','2012-04-05 14:50:47',NULL),(1922,'Language','My child understands if-then sentences. For example, #he/she# understands me when I say, We\'ll buy that toy if we find it in the store. ',48,'2012-04-05 14:50:47','2012-04-05 14:50:47',NULL),(1923,'Language','My child is sometimes confused when I use the passive voice. That is, #he/she# understands the sentence, The truck hit the car, but is confused by, The car was hit by the truck.',48,'2012-04-05 14:50:47','2012-04-05 14:50:47',NULL),(1924,'Logic','My baby seems interested in the things around #him/her#. ##He/She## sleeps a lot, but with each passing day #he/she# is more wide-eyed and attentive.',0,'2012-04-05 14:50:47','2012-04-05 14:50:47',NULL),(1925,'Logic','My baby seems to notice certain things around #him/her#. For example,  although there are many things in the room, #he/she# mostly pays attention to things with interesting shapes or complex patterns.',0,'2012-04-05 14:50:47','2012-04-05 14:50:47',NULL),(1926,'Logic','My baby seems to anticipate patterns, like the way I\'m going to respond to #him/her#. For example, #he/she# stops crying just before I pick #him/her# up, like #he/she# expects that to happen.',1,'2012-04-05 14:50:47','2012-04-05 14:50:47',NULL),(1927,'Logic','My baby notices changes in patterns.  For example, #he/she# stops smiling after watching my finger swing playfully from side to side; but when I begin swinging it up and down, #he/she# once again widens #his/her# eyes and smiles.',1,'2012-04-05 14:50:47','2012-04-05 14:50:47',NULL),(1928,'Logic','My baby seems to know what\'s going to happen next in certain familiar situations. For example, #he/she# opens #his/her# mouth as I bring a nipple or pacifier closer to #his/her# face.',2,'2012-04-05 14:50:48','2012-04-05 14:50:48',NULL),(1929,'Logic','My baby likes to make things happen. ##He/She## repeatedly kicks at the mobile above #his/her# crib, cooing and smiling when #he/she# makes the pieces move.',2,'2012-04-05 14:50:48','2012-04-05 14:50:48',NULL),(1930,'Logic','My baby knows that something is whole even if #he/she# only sees part of it. ##He/She## grabs for #his/her# pacifier even when it is partially covered by #his/her# blanket.',3,'2012-04-05 14:50:48','2012-04-05 14:50:48',NULL),(1931,'Logic','My baby can remember what #he/she# does to make things happen and #he/she# may do it again to make the same thing happen again. For example,  when #he/she# sticks out #his/her# tongue, I tickle #his/her# tummy, and then #he/she# giggles and sticks out #his/her# tongue again.',3,'2012-04-05 14:50:48','2012-04-05 14:50:48',NULL),(1932,'Logic','My baby seems to understand that hidden objects are still there even if #he/she# can\'t see them. For example, when I hide a small toy in my hand,  #he/she# focuses on my hand. It\'s like #he/she# is just waiting for me to open up my hand so #he/she# can get the toy back.',4,'2012-04-05 14:50:48','2012-04-05 14:50:48',NULL),(1933,'Logic','My baby makes connections between what makes what happen. For example,  when the door begins to open, #he/she# looks toward the upper part of the door, as if to see who\'s there. ##He/She## seems to understand the connection between the door opening and someone coming in.',4,'2012-04-05 14:50:48','2012-04-05 14:50:48',NULL),(1934,'Logic','My baby adjusts #his/her# behavior to fit with my way of doing things.  ##He/She## seems to know that it takes me about a minute to get to where #he/she# is sleeping, and #he/she# will hold off  about that long when #he/she# wakes up from a nap before crying.',4,'2012-04-05 14:50:48','2012-04-05 14:50:48',NULL),(1935,'Logic','My baby seems to notice changes in the amounts of things. For example, if two toys are in front of #him/her# and I take one away, #he/she# looks surprised as #he/she# notices the empty space where the second toy was,  and then at the toy #he/she# has left.',5,'2012-04-05 14:50:49','2012-04-05 14:50:49',NULL),(1936,'Logic','My baby can match small amounts of things. For example, if #he/she# hears two voices, but sees just one person, like when #he/she# is in the stroller and can\'t see the person pushing, #he/she# becomes wide-eyed and seems curious about what #he/she# hears.',6,'2012-04-05 14:50:49','2012-04-05 14:50:49',NULL),(1937,'Logic','My baby seems interested in figuring out how things happen. For example, #he/she# accidentally discovered that kicking the mobile made it rotate,  and then #he/she# began kicking it more, as if trying to make it rotate again.',6,'2012-04-05 14:50:49','2012-04-05 14:50:49',NULL),(1938,'Logic','My baby can solve problems. When a toy is out of reach, #he/she# often uses another toy to help get it.',7,'2012-04-05 14:50:49','2012-04-05 14:50:49',NULL),(1939,'Logic','My baby seems to notice if things are equal or not. For example, #he/she# looks back and forth between #his/her# snack bowl that has one cracker and #his/her# sibling\'s snack bowl that has two crackers. It\'s like #he/she# knows they don\'t have the same amount of crackers.',7,'2012-04-05 14:50:49','2012-04-05 14:50:49',NULL),(1940,'Logic','My baby understands that hidden things can be found. For example, when I hide a toy under #his/her# blanket, #he/she# often searches around the blanket.',8,'2012-04-05 14:50:49','2012-04-05 14:50:49',NULL),(1941,'Logic','My child can copy what #he/she# saw someone else do the day before. For instance, yesterday #he/she# saw me make #his/her# teddy bear dance on the table, leap in the air, and then give another bear a hug. Today, #he/she# did the same thing.',9,'2012-04-05 14:50:49','2012-04-05 14:50:49',NULL),(1942,'Logic','My child expects certain things to cause other things. For example,  #he/she# knows that if #he/she# pushes the red firetruck #he/she# will hear the siren. When the batteries were low and the siren didn\'t work,  #he/she# seemed surprised.',9,'2012-04-05 14:50:49','2012-04-05 14:50:49',NULL),(1943,'Logic','My child knows a little about what things should weigh and expects bigger things to be heavy.  For instance, when I handed #him/her# a large, very light beach ball, #he/she# lost #his/her# balance a little and seemed surprised, as if it were much lighter than #he/she# thought it would be',10,'2012-04-05 14:50:49','2012-04-05 14:50:49',NULL),(1944,'Logic','My child can make a plan that involves doing two or three things in order to solve a problem. For instance, in order to get a toy that is just out of reach, #he/she# will move something that is in the way, pull on a blanket that the toy is on and pull the toy to #him/her#.',10,'2012-04-05 14:50:50','2012-04-05 14:50:50',NULL),(1945,'Logic','My child knows that some objects are just like other ones.  For instance if I put out a spoon and a knife and ask #him/her# to find one \"just like it\" #he/she# picks up a fork.',12,'2012-04-05 14:50:50','2012-04-05 14:50:50',NULL),(1946,'Logic','My child uses complex strategies to solve a problem when simple ones don\'t work. For instance, in order to get a balloon that floated to the ceiling, #he/she# reached up, climbed on a chair and still couldn\'t get it, then used a toy to hit it down.',12,'2012-04-05 14:50:50','2012-04-05 14:50:50',NULL),(1947,'Logic','My child seems to notice when one group of things is less or more than another group of things, but only when the amounts #he/she# compares are very small.  For instance, when I gave #him/her# a plate with one cookie and an older child two cookies, #he/she# looked at the plate with two,  looked at me, and then reached out toward the plate with two cookies while looking at me.',15,'2012-04-05 14:50:50','2012-04-05 14:50:50',NULL),(1948,'Logic','My child can figure out how heavy different things are based on their size and then adjust the way #he/she# grasps them. For example, #his/her# arms drops the same amount no matter if #he/she# is grasping light or heavy things.',15,'2012-04-05 14:50:50','2012-04-05 14:50:50',NULL),(1949,'Logic','My child sorts things and puts the different groups in different places. For instance, I noticed #him/her# putting all the plastic animals in a pile on one side of #him/her# and all the toy cars in a pile on the other side of #him/her#.',18,'2012-04-05 14:50:50','2012-04-05 14:50:50',NULL),(1950,'Logic','My child groups things together in collections. ##He/She## calls the trucks, blocks, and farm animals toys, but the dolls are dolls, not  toys.',21,'2012-04-05 14:50:50','2012-04-05 14:50:50',NULL),(1951,'Logic','My child finds similarities in the way different things work, so that if #he/she# can\'t find the exact thing #he/she# needs, #he/she# finds another thing to do the same job. For example, #he/she# knows that if #he/she# can\'t find #his/her# red wagon to hold all of #his/her# toys, #he/she# can use #his/her# toy shopping cart. ##He/She## knows that they both hold things even though they don\'t look exactly the same.',21,'2012-04-05 14:50:50','2012-04-05 14:50:50',NULL),(1952,'Logic','My child can match things one to one. If I ask #him/her# to help set the table by giving everyone a napkin, #he/she# puts one napkin on each person\'s plate.',24,'2012-04-05 14:50:50','2012-04-05 14:50:50',NULL),(1953,'Logic','My child can keep track of the things #he/she# has tried to do while solving a problem. For example, #he/she# won\'t try to pull on the door handle again and again if it didn\'t work to open the door the first time. ##He/She## tries something new, like twisting the handle.',24,'2012-04-05 14:50:50','2012-04-05 14:50:50',NULL),(1954,'Logic','My child knows about the order of things, especially things we do every day. For example, #he/she# gets upset if I suggest that we read a bedtime story before brushing teeth and getting into pajamas. We always read a book last, right before lights out.',27,'2012-04-05 14:50:50','2012-04-05 14:50:50',NULL),(1955,'Logic','My child asks why things happen. For example, #he/she# often asks why #his/her# baby brother cries.',27,'2012-04-05 14:50:51','2012-04-05 14:50:51',NULL),(1956,'Logic','My child knows the order of the first few counting words. #He/She# always says, \"One two three go!\" in that order when #he/she# is ready to jump off the bottom step.',30,'2012-04-05 14:50:51','2012-04-05 14:50:51',NULL),(1957,'Logic','My child knows what something really is even when it is different from what it looks like on the outside. If #he/she# drops some food on the floor, #he/she# understands that it is dirty even though it may look clean.',30,'2012-04-05 14:50:51','2012-04-05 14:50:51',NULL),(1958,'Logic','My child corrects #himself/herself# when #he/she# makes a mistake while solving a problem. For instance, #he/she# might start off putting the nesting cups together correctly, but then if #he/she# picks one that doesn\'t fit, #he/she# won\'t just dump the cups. ##He/She## will take the cup that was too small or too big out and try a different cup.',30,'2012-04-05 14:50:51','2012-04-05 14:50:51',NULL),(1959,'Logic','For very small amounts, my child knows how many things there are in a group by counting each one and using the last number as the total amount. For example, when I ask #him/her# how many apples we have, #he/she# counts, \"one two three. Three apples!\"',33,'2012-04-05 14:50:51','2012-04-05 14:50:51',NULL),(1960,'Logic','My child knows that something can be a model that represents something else. If we are doing a puzzle, #he/she# knows that the picture on the box is a small model of the puzzle, so #he/she# can use it to see where certain pieces go.',33,'2012-04-05 14:50:51','2012-04-05 14:50:51',NULL),(1961,'Logic','My child knows that things can be counted even if they are not all alike. #He/She# counts everything #he/she# sees, no matter if the things go together like all the crayons that spilled on the floor, or if the things are just around #him/her#, like the crayons, books, stickers, and socks that are on #his/her# desk.',36,'2012-04-05 14:50:51','2012-04-05 14:50:51',NULL),(1962,'Logic','My child uses words like know\" and \"think\" and seems to understand what it means to know and to think. If #he/she# can see in #his/her# toy box but I can\'t #he/she# knows I won\'t know what is in there.',36,'2012-04-05 14:50:51','2012-04-05 14:50:51',NULL),(1963,'Logic','My child has figured out a way to measure amounts to share. #He/She# shares by counting out equal numbers of things for each person, but #he/she# doesn\'t consider if each of the things is the same size. For example, #he/she# will break up a big mound of playdoh and give #himself/herself# three big clumps. Then, running out of playdoh, #he/she# gives me three small clumps and says, We have the same!\"\"',36,'2012-04-05 14:50:51','2012-04-05 14:50:51',NULL),(1964,'Logic','My child knows that things don\'t just happen, that something causes things to happen. For example, if my hair is dry when I leave the room and then I come back with wet hair, #he/she# wants to know what made my hair wet.  ##He/She## doesn\'t believe me if I say that it just got that way.',42,'2012-04-05 14:50:51','2012-04-05 14:50:51',NULL),(1965,'Logic','My child can put some things into categories. For example, #he/she# calls the pigeons at the park and the seagulls at the beach birds.  Sometimes #he/she# puts things into categories just because they go together as a theme like grouping together trucks and dirt because the trucks carry the dirt.',42,'2012-04-05 14:50:51','2012-04-05 14:50:51',NULL),(1966,'Logic','My child knows and can count the numbers one to ten, but after that,  #he/she# has a little difficulty and may say, \"ten one\" instead of eleven.',42,'2012-04-05 14:50:51','2012-04-05 14:50:51',NULL),(1967,'Logic','My child can make inferences and understands that if a=b and b=c, then a=c. For example, #he/she# told me that #he/she# would be able to do the monkey bars when #he/she# is six. ##He/She## explained that if #his/her# sister is six and someone who is six can do the monkey bars, then #he/she# will be able to do the monkey bars when #he/she# is six.',48,'2012-04-05 14:50:52','2012-04-05 14:50:52',NULL),(1968,'Logic','My child knows that #he/she# can count a bunch of things in any order and still come out with the same amount. For example, #he/she# may count a bunch of M&Ms starting at the bottom. Then, if I ask #him/her# to count again, #he/she# may start at the top because #he/she# knows #he/she# will get the same amount either way.',48,'2012-04-05 14:50:52','2012-04-05 14:50:52',NULL);
